import ReactDOM from 'react-dom';
import Main from './Main';

ReactDOM.render(<Main />, document.getElementById('root'));

const express = require('express');
const app = express();
const PORT = process.env.port || 8000;

app.listen(PORT,()=>{
  console.log('running on port ${PORT}');
});
